import React from 'react';
import ReactDOM from 'react-dom';
import {GlobalStyle} from  './style';
import {GlobalStyle1} from  './statics/iconfont/iconfont';
import App from './App';
ReactDOM.render(
  <React>
    <App />
    <GlobalStyle />
    <GlobalStyle1 />
  </React>,
  document.getElementById('root')
);
